window.bookSummaryJSON = "<p>Start the first season of the groundbreaking postapocalyptic serial: <i>Yesterday's Gone: Season One</i> (episodes 1-6). </p> <p>WARNING: This is a postapocalyptic horror audiobook where bad people do evil things, and as such, this series features disturbing scenes and foul language. While it is all within the context of the story, some listeners may find this content offensive. </p> <p>Can humanity survive what it never saw coming? On October 15 at 2:15 a.m. Earth vanished. A scattered few woke alone in a world with no rules, other than survival at any cost. A journalist wanders the wretched reality of an empty New York, searching for his wife and son. A serial killer must hunt in a land where prey is now an endangered species. A mother shields her young daughter from danger through every terror-filled breath. </p> <p>A bullied teen is thrilled to find the world gone missing, until the knock on his door. A fugitive survives a fiery plane crash. Will he be redeemed, or return to the killing he's best at? An eight-year-old boy sets out on a journey to find his missing family, only to find something that will change him forever. These survivors aren't truly alone.... Someone or something is watching them. And waiting... </p> <p>Strangers unite. Sides are chosen. Can humanity survive what it never saw coming?</p>"; 
